import{_ as s,c as a,o,V as t}from"./chunks/framework.a7f1c75a.js";const m=JSON.parse('{"title":"VSC为什么自动补全后引号内变成灰色，导致引号内智能感知失效？","description":"","frontmatter":{},"headers":[],"relativePath":"杂项/编辑器/VSC为什么自动补全后引号内变成灰色，导致引号内智能感知失效？.md","lastUpdated":1681627181000}'),p={name:"杂项/编辑器/VSC为什么自动补全后引号内变成灰色，导致引号内智能感知失效？.md"},n=t(`<h1 id="vsc为什么自动补全后引号内变成灰色-导致引号内智能感知失效" tabindex="-1">VSC为什么自动补全后引号内变成灰色，导致引号内智能感知失效？ <a class="header-anchor" href="#vsc为什么自动补全后引号内变成灰色-导致引号内智能感知失效" aria-label="Permalink to &quot;VSC为什么自动补全后引号内变成灰色，导致引号内智能感知失效？&quot;">​</a></h1><blockquote><p>VS Code版本：<strong>version 1.36.1</strong> 操作系统：<strong>win10</strong></p></blockquote><p><strong>自动补全后引号内背景变成灰色，导致引号内的输入智能感知失效</strong></p><ol><li>自动补全后引号内背景变成灰色：如下图</li></ol><p><img src="https://pic2.zhimg.com/v2-6452992e66ad5df6120ee5aa83efaf59_b.jpg" alt="img">此时选择自动补全</p><p><img src="https://pic4.zhimg.com/v2-3a4b607ba9df2d52adc10ab527667077_b.jpg" alt="img">自动补全后(除了提示符以外出现了额外的一条线在引号外)</p><ol start="2"><li>此时继续输入，引号内的内容变成灰色，引号内智能感知失效</li></ol><p><img src="https://pic1.zhimg.com/v2-2f359eecb33065ae1866782df6b3228c_b.jpg" alt="img"></p><ol start="3"><li>如果不采用自动补全，用键盘敲出class=&quot;&quot;，引号内智能感知仍有效</li></ol><p><img src="https://pic4.zhimg.com/v2-2ec0ad643519b0936c4b82601cf9f643_b.jpg" alt="img">直接用键盘敲后不会出现额外的竖线</p><p><img src="https://pic2.zhimg.com/v2-7bc39213a010ed5199e7823f86cb5ca5_b.jpg" alt="img">在引号内输入内容不会出现灰色背景，智能感知仍然有效</p><ol start="4"><li>在状态1和2下移动提示符到引号外后可以变为状态3，恢复智能感知</li></ol><h2 id="作者-谭九鼎" tabindex="-1">作者：谭九鼎 <a class="header-anchor" href="#作者-谭九鼎" aria-label="Permalink to &quot;作者：谭九鼎&quot;">​</a></h2><p>链接：<a href="https://www.zhihu.com/question/335637208/answer/753693134" target="_blank" rel="noreferrer">https://www.zhihu.com/question/335637208/answer/753693134</a></p><p>来源：知乎</p><p>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p><p>有两种可能：</p><div class="language-json line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">json</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">editor.quickSuggestions</span><span style="color:#89DDFF;">&quot;</span><span style="color:#A6ACCD;">: </span><span style="color:#89DDFF;">{</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">other</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">true,</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">comments</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">false,</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">strings</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">true</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">}</span><span style="color:#A6ACCD;">,</span></span>
<span class="line"><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">editor.suggest.snippetsPreventQuickSuggestions</span><span style="color:#89DDFF;">&quot;</span><span style="color:#A6ACCD;">: </span><span style="color:#89DDFF;">false</span><span style="color:#A6ACCD;">,</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>或者什么也不改，手动按ctrl加space也能触发（前提是你用的是纯英文输入法）。</p><p>变成灰色那是snippets的效果，按tab就能跳到下一个点去。</p>`,20),e=[n];function l(r,c,i,_,D,u){return o(),a("div",null,e)}const g=s(p,[["render",l]]);export{m as __pageData,g as default};
